                    using (var cmd = cn.CreateCommand())
                    {
                        cmd.CommandText = $"""
                   create table [{tableName}]
                   (
                       [Id] [int] NOT NULL,
                       [DocumentIdentificationId] [uniqueidentifier] NOT NULL,
                       [Name] [nvarchar](40) NULL,
                       [Value] [nvarchar](max) NULL
                   )
                   """;

