                            docId.Value = row.DocumentIdentificationId;
                            name.Value = row.Name;
                            value.Value = row.Value == null ? DBNull.Value : row.Value;
                            await cmd.ExecuteNonQueryAsync();
                        }
                    }

                    SqlConnectionStringBuilder builder = new SqlConnectionStringBuilder(DataTestUtility.TCPConnectionString);
                    builder.PersistSecurityInfo = true;
                    builder.Pooling = false;
                    
                    for (int packetSize = 512; packetSize<2048; packetSize++)
                    {
                        builder.PacketSize = packetSize;
                        using (SqlConnection sizedConnection = new SqlConnection(builder.ToString()))
                        using (SqlCommand cmd = sizedConnection.CreateCommand())
                        {
                            sizedConnection.Open();

                            cmd.CommandText = $"SELECT [d].[Id], [d].[DocumentIdentificationId], [d].[Name], [d].[Value] FROM [{tableName}] AS [d]";
                            using (var reader = await cmd.ExecuteReaderAsync())
                            {
                                int row = 0;
                                while (await reader.ReadAsync())
                                {
                                    int id = await reader.GetFieldValueAsync<int>(0, default);
                                    Guid docId = await reader.GetFieldValueAsync<Guid>(1, default);
                                    string name = await reader.GetFieldValueAsync<string>(2, default);
                                    string value = null;
                                    if (!await reader.IsDBNullAsync(3, default))
                                    {
                                        value = await reader.GetFieldValueAsync<string>(3, default);
                                    }

                                    Assert.Equal(id, rows[row].Id);
                                    Assert.Equal(docId, rows[row].DocumentIdentificationId);
                                    Assert.Equal(name, rows[row].Name);
                                    Assert.Equal(value, rows[row].Value);
                                    row += 1;
                                }
                            }
                        }
                    }
                }
                finally
                {
                    try
                    {
                        DataTestUtility.DropTable(cn, tableName);
                    }
                    catch
                    {
                    }
                }
            }
